#
# TABLE STRUCTURE FOR: shares
#

DROP TABLE IF EXISTS `shares`;

CREATE TABLE `shares` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `users_id` int(10) unsigned NOT NULL COMMENT 'Id участников',
  `condition_shares` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Усливие акции',
  `gain` int(10) unsigned NOT NULL COMMENT 'Выигрыш',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Акции';



